import React from "react";
import { dataImages } from "../images/images";
import styled from "styled-components";

const Choices = () => {
  return (
    <Wrapper>
      <div>
        <button>
          <img src={`${dataImages[0]}`} />
        </button>
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.div``;

export default Choices;
